import React from 'react'
import "./Checkout.css";

function Checkout() {
  return (
    <div className='checkout'>
      <div className='checkout__left'>
        <img className='checkout__ad' src='https://www.featuredproductsusa.com/wp-content/uploads/2019/10/ocean_credit02-1024x256.png' alt=''/>
        
      </div>
    </div>
  )
}

export default Checkout
